import { createGlobalStyle } from 'styled-components';

export default createGlobalStyle `

*{
    margin: 0;
    padding: 0;
    outline: 0;
    box-sizing: border-box;

}

html, body, #root {
    height: 100%;
}

*, button, input {
    border: 0;
    outline: 0;
    font-family: 'Secular One', sans-serif;
    -webkit-font-smoothing: antialiased !important;
    font-weight: 400;
}

button {
    cursor: pointer;
}
`
